The inputs to all modkit dmr commands are two or more bedMethyl files (created by modkit pileup) that have been compressed with bgzip and indexed with tabix . An example of how to generate the input data is shown below: ref=grch38.fasta
threads=32 norm=normal_sample.bam
norm_pileup=normal_pileup.bed modkit pileup ${norm} ${norm_pileup} \ --cpg \ --ref ${ref} \ --threads ${threads} \ --log-filepath log.txt bgzip -k ${norm_pileup}
tabix -p bed ${norm_pileup}.gz # pileup and compression can also be done in one step
tumor=tumor_sample.bam
tumor_pileup=tumor_pileup.bed.gz modkit pileup ${tumor} - \ --cpg \ --ref ${ref} \ --threads ${threads} \ --log-filepath log.txt | ${bgzip} -c > ${tumor_pileup} tabix -p bed ${tumor_pileup}
